import React from "react";

const linkStyle = {
	fontSize: "1.5em",
	textDecoration: "none"
};

export default class SideBarItem extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			color: "white",
			scaleUp: false
		};

		this.determineStyle = this.determineStyle.bind(this);
	}

	determineStyle() {
		const color = this.state.color;
		if (this.state.scaleUp) {
			return {
				width: "1em",
				height: "1em",
				fill: { color }
			};
		} else {
			return {
				width: ".15em",
				height: ".075em",
				fill: { color }
			};
		}
	}

	render() {
		console.log("hit");
		return (
			<div className="sideBarItem">
				<a
					className="sideBarItem-title"
					href={`#${this.props.title}Marker`}
					style={linkStyle}
				>
					{this.props.title}
				</a>
				<svg style={{ width: "400", height: "110" }}>
					<rect style={this.determineStyle()} />
					Sorry, your browser does not support inline SVG.
				</svg>
			</div>
		);
	}
}
